import React from 'react'
import {Link} from "react-router-dom";

import "../css/breadcrumb.css"

const HandleClick = (e) =>
{
    e.preventDefault();
}

export default function Breadcrumb({content, location}) {
  return (
    <div className='flex'>
        <Link to={location + "/" + content} onClick={HandleClick()}>{content}</Link>
    </div>
  )
}
